import { Component } from 'react';
import '../styles//mediaCard.css';

function Media(props) {
    return (
        <div className="Media">
            {props.data.length != 0  ? 
            <div>

                <br/>
                <br/>
                <br/>
                <br/>

            {props.data.map(p => <div>
                <div className="title">{p.data[0].title}</div>
                <div className="img"><img width="520" height="315" src={p.links[0].href}></img></div> 
             </div>)}
            </div>
            : null}

        </div>
    )
}

export default Media;
